INSERT INTO ratethemoviedb.person (id, date_of_birth, description, employment_job, image_url, name) VALUES (4, '1985-07-15 22:00:00', 'Rosa Bianca Salazar is an American actress. She had roles in the NBC series Parenthood and the FX anthology series American Horror Story: Murder House. She played the title character in the film Alita: Battle Angel.', 0, 'http://www.gstatic.com/tv/thumb/persons/649624/649624_v9_bb.jpg', 'Rosa Salazar');
INSERT INTO ratethemoviedb.person (id, date_of_birth, description, employment_job, image_url, name) VALUES (5, '1956-10-03 23:00:00', 'Christoph Waltz is a German-Austrian film and voice actor and director mainly active in the United States.', 0, 'http://www.gstatic.com/tv/thumb/persons/171314/171314_v9_bb.jpg', 'Christoph Waltz');
INSERT INTO ratethemoviedb.person (id, date_of_birth, description, employment_job, image_url, name) VALUES (6, '1970-12-11 23:00:00', 'Jennifer Lynn Connelly is an American actress who began her career as a child model. She appeared in magazine, newspaper and television advertising, before she made her film acting debut in the crime film Once Upon a Time in America.', 0, 'http://www.gstatic.com/tv/thumb/persons/350/350_v9_bb.jpg', 'Jennifer Connelly');
INSERT INTO ratethemoviedb.person (id, date_of_birth, description, employment_job, image_url, name) VALUES (23, '1964-09-01 23:00:00', 'Keanu Charles Reeves is a Canadian actor and musician. He gained fame for his starring role performances in several blockbuster films, including comedies from the Bill and Ted franchise.', 0, 'http://www.gstatic.com/tv/thumb/persons/1443/1443_v9_bb.jpg', 'Keanu Reeves');
INSERT INTO ratethemoviedb.person (id, date_of_birth, description, employment_job, image_url, name) VALUES (24, '1966-08-13 23:00:00', 'Halle Maria Berry is an American actress. Berry won the Academy Award for Best Actress for her performance in the romantic drama film Monster''s Ball, becoming the only woman of African American descent to have won the award.', 0, 'http://www.gstatic.com/tv/thumb/persons/153/153_v9_bc.jpg', 'Halle Berry');
INSERT INTO ratethemoviedb.person (id, date_of_birth, description, employment_job, image_url, name) VALUES (26, '1963-12-17 23:00:00', 'William Bradley Pitt is an American actor and film producer. He has received multiple awards and nominations including an Academy Award as producer under his own company, Plan B Entertainment. Pitt first gained recognition as a cowboy hitchhiker in the road movie Thelma &amp; Louise.', 0, 'http://www.gstatic.com/tv/thumb/persons/1366/1366_v9_bb.jpg', 'Brad Pitt');
INSERT INTO ratethemoviedb.person (id, date_of_birth, description, employment_job, image_url, name) VALUES (27, '1986-06-10 22:00:00', 'Shia Saide LaBeouf is an American actor, performance artist, and filmmaker. He became known among younger audiences as Louis Stevens in the Disney Channel series Even Stevens, a role for which LaBeouf received a Young Artist Award nomination in 2001 and won a Daytime Emmy Award in 2003.', 0, 'http://www.gstatic.com/tv/thumb/persons/189825/189825_v9_bb.jpg', 'Shia LaBeouf');
INSERT INTO ratethemoviedb.person (id, date_of_birth, description, employment_job, image_url, name) VALUES (30, '1965-04-03 23:00:00', 'Robert John Downey Jr. is an American actor. His career has included critical and popular success in his youth, followed by a period of substance abuse and legal difficulties, and a resurgence of commercial success in middle age.', 0, 'http://www.gstatic.com/tv/thumb/persons/67369/67369_v9_bb.jpg', 'Robert Downey, Jr.');
INSERT INTO ratethemoviedb.person (id, date_of_birth, description, employment_job, image_url, name) VALUES (31, '1981-06-12 22:00:00', 'Christopher Robert Evans is an American actor. Evans is known for his superhero roles as the Marvel Comics characters Captain America in the Marvel Cinematic Universe and Human Torch in Fantastic Four and its 2007 sequel.', 0, 'http://www.gstatic.com/tv/thumb/persons/173489/173489_v9_ba.jpg', 'Chris Evans');
INSERT INTO ratethemoviedb.person (id, date_of_birth, description, employment_job, image_url, name) VALUES (32, '1984-11-21 23:00:00', 'Scarlett Ingrid Johansson is an American actress and singer. Johansson is the world&#39;s highest-paid actress, has made multiple appearances in the Forbes Celebrity 100, and has a star on the Hollywood Walk of Fame.', 0, 'http://www.gstatic.com/tv/thumb/persons/69369/69369_v9_bb.jpg', 'Scarlett Johansson');
INSERT INTO ratethemoviedb.person (id, date_of_birth, description, employment_job, image_url, name) VALUES (33, '1983-08-10 22:00:00', 'Christopher Hemsworth is an Australian actor. He rose to prominence playing Kim Hyde in the Australian TV series Home and Away.', 0, 'http://www.gstatic.com/tv/thumb/persons/528854/528854_v9_ba.jpg', 'Chris Hemsworth');
INSERT INTO ratethemoviedb.person (id, date_of_birth, description, employment_job, image_url, name) VALUES (34, '1996-05-31 22:00:00', 'Thomas Stanley Holland (born 1 June 1996) is an English actor and dancer. A graduate of the BRIT School in London, he is known for playing Spider-Man in the Marvel Cinematic Universe (MCU), so far appearing or starring in five films: Captain America: Civil War (2016), Spider-Man: Homecoming (2017), Avengers: Infinity War (2018), Avengers: Endgame (2019), and the upcoming Spider-Man: Far From Home (2019).', 0, 'http://www.gstatic.com/tv/thumb/persons/733885/733885_v9_bb.jpg', 'Tom Holland');
INSERT INTO ratethemoviedb.person (id, date_of_birth, description, employment_job, image_url, name) VALUES (35, '1967-11-21 23:00:00', 'Mark Alan Ruffalo is an American actor and producer. He made his screen debut in an episode of CBS Summer Playhouse, followed by minor film roles, and was part of the original cast of This Is Our Youth. Following roles were in 13 Going on 30, Eternal Sunshine of the Spotless Mind, Zodiac, and What Doesn''t Kill You.', 0, 'http://www.gstatic.com/tv/thumb/persons/43389/43389_v9_bb.jpg', 'Mark Ruffalo');
INSERT INTO ratethemoviedb.person (id, date_of_birth, description, employment_job, image_url, name) VALUES (36, '1979-06-20 22:00:00', 'Christopher Michael Pratt is an American actor. He rose to prominence for his television roles, particularly as Andy Dwyer in the NBC sitcom Parks and Recreation, for which he received critical acclaim and was nominated for the Critics'' Choice Television Award for Best Supporting Actor in a Comedy Series in 2013.', 0, 'http://www.gstatic.com/tv/thumb/persons/249381/249381_v9_bb.jpg', 'Chris Pratt');
INSERT INTO ratethemoviedb.person (id, date_of_birth, description, employment_job, image_url, name) VALUES (37, '1981-02-08 23:00:00', 'Thomas William Hiddleston is an English actor, film producer and musician. At the beginning of his career, he appeared in West End theatre productions of Cymbeline and Ivanov.', 0, 'http://www.gstatic.com/tv/thumb/persons/286678/286678_v9_bb.jpg', 'Tom Hiddleston');
INSERT INTO ratethemoviedb.person (id, date_of_birth, description, employment_job, image_url, name) VALUES (44, '1978-06-18 22:00:00', 'Zoë Yadira Saldaña Nazario is an American actress and dancer. Following her performances with the theater group Faces, Saldana made her screen debut in a 1999 episode of Law & Order. Saldana''s film career began a year later with Center Stage, where she played a struggling ballet dancer.', 0, 'http://www.gstatic.com/tv/thumb/persons/194024/194024_v9_bb.jpg', 'Zoe Saldana');
INSERT INTO ratethemoviedb.person (id, date_of_birth, description, employment_job, image_url, name) VALUES (45, '1969-01-17 23:00:00', 'David Michael Bautista Jr. is an American actor, retired professional wrestler, former mixed martial artist and bodybuilder. Bautista began his wrestling career in 1999, and signed with the World Wrestling Federation in 2000.', 0, 'http://www.gstatic.com/tv/thumb/persons/566644/566644_v9_bb.jpg', 'Dave Bautista');
INSERT INTO ratethemoviedb.person (id, date_of_birth, description, employment_job, image_url, name) VALUES (46, '1975-01-04 23:00:00', 'Bradley Charles Cooper is an American actor and filmmaker. He has been nominated for many awards, including seven Academy Awards and a Tony Award, and has won a Grammy Award and a BAFTA Award. Cooper appeared in Forbes Celebrity 100 on two occasions and Time''s list of 100 most influential people in the world in 2015. ', 0, 'http://www.gstatic.com/tv/thumb/persons/232104/232104_v9_bb.jpg', 'Bradley Cooper');
INSERT INTO ratethemoviedb.person (id, date_of_birth, description, employment_job, image_url, name) VALUES (48, '1967-07-17 23:00:00', 'Mark Sinclair, better known by his stage name Vin Diesel, is an American actor, producer, director and screenwriter. After featuring in the epic film Saving Private Ryan, he rose to international fame with his role as Dominic Toretto in The Fast and the Furious franchise.', 0, 'http://www.gstatic.com/tv/thumb/persons/79719/79719_v9_bb.jpg', 'Vin Diesel');
INSERT INTO ratethemoviedb.person (id, date_of_birth, description, employment_job, image_url, name) VALUES (51, '1963-06-08 23:00:00', 'John Christopher Depp II is an American actor, producer and musician. He has been nominated for ten Golden Globe Awards, winning one for Best Actor for his performance of the title role in Sweeney Todd.', 0, 'http://www.gstatic.com/tv/thumb/persons/33623/33623_v9_bc.jpg', 'Johnny Depp');
INSERT INTO ratethemoviedb.person (id, date_of_birth, description, employment_job, image_url, name) VALUES (52, '1985-03-25 23:00:00', 'Keira Christina Knightley, OBE is an English actress and model. She has received an Empire Award and multiple nominations for British Academy, Golden Globe, and Academy Awards.', 0, 'http://www.gstatic.com/tv/thumb/persons/245574/245574_v9_bb.jpg', 'Keira Knightley');
INSERT INTO ratethemoviedb.person (id, date_of_birth, description, employment_job, image_url, name) VALUES (53, '1977-01-12 23:00:00', 'Orlando Jonathan Blanchard Bloom is an English actor. After making his breakthrough as Legolas in The Lord of the Rings film series, he rose to fame by further appearing in epic fantasy, historical epic, and fantasy adventure films. He later reprised his role as Legolas in The Hobbit film series.', 0, 'http://www.gstatic.com/tv/thumb/persons/288723/288723_v9_bc.jpg', 'Orlando Bloom');
INSERT INTO ratethemoviedb.person (id, date_of_birth, description, employment_job, image_url, name) VALUES (54, '1992-03-12 23:00:00', 'Kaya Rose Scodelario-Davis is an English actress. She is best known for her roles as Effy Stonem on the E4 teen drama Skins, Teresa in The Maze Runner film series and Carina Smyth in the adventure film Pirates of the Caribbean: Dead Men Tell No Tales.', 0, 'http://www.gstatic.com/tv/thumb/persons/533946/533946_v9_bb.jpg', 'Kaya Scodelario');
INSERT INTO ratethemoviedb.person (id, date_of_birth, description, employment_job, image_url, name) VALUES (55, '1951-07-05 23:00:00', 'Geoffrey Roy Rush AC is an Australian actor. Rush is amongst 24 people who have won the Triple Crown of Acting: an Academy Award, a Primetime Emmy Award, and a Tony Award. He has won one Academy Award for acting, three British Academy Film Awards, two Golden Globe Awards, and four Screen Actors Guild Awards. ', 0, 'http://www.gstatic.com/tv/thumb/persons/68693/68693_v9_bb.jpg', 'Geoffrey Rush');